// type HonorProps = MedalProps & {
//   honorId: number;
// };

const Honor: React.FC<HonorProps> = (props) => {
  const variantsMap = new Map();
  variantsMap.set(1, "internal");
  variantsMap.set(2, "gold");
  variantsMap.set(3, "silver");
  variantsMap.set(4, "bronze");
  variantsMap.set(5, "battle");
  variantsMap.set(6, "pilgrim");

  if (!variantsMap.has(props.honorId)) return <></>;
  return (
    <HoverCard>
      <HoverCardTrigger asChild>
        <Medal
          honorId={props.honorId}
          variant={variantsMap.get(props.honorId)}
        />
      </HoverCardTrigger>
      <HoverCardContent className="w-fit">
        <div className="flex justify-between space-x-4">
          <div className="space-y-1">
            <h4 className="text-sm font-semibold">Torneio do Macaco</h4>
            <p className="text-sm">
              Conquistado no 123º Torneio Anual do Macaco.
            </p>
            <div className="flex items-center pt-2">
              <CalendarIcon className="mr-2 h-4 w-4 opacity-70" />
              <span className="text-xs text-muted-foreground">
                Dezembro de 2023
              </span>
            </div>
          </div>
        </div>
      </HoverCardContent>
    </HoverCard>
  );
};

export { Honor };
